import './App.css';
import Navbar from './components/Navbar';

function App() {
  return (
    <>
      <Navbar title="TradeMAX" />

      <section className="justify-center antialiased bg-gray-50 text-gray-600 min-h-screen p-4">
        <div className="h-full">

          <div className="max-w-2xl mx-auto bg-indigo-600 shadow-lg rounded-lg">
            <div className="px-6 py-5">
              {/* <div className="flex items-start"> */}

                    <h2 className="text-2xl leading-snug font-extrabold text-gray-50 truncate mb-1 sm:mb-0">Key Value Indicator: XX.XX</h2>

              {/* </div> */}
            </div>
          </div>
        </div>
      </section>
    </>
  );
}

export default App;
